/* 
  Class that contain the information of the user of the web app. 
*/
import React, { Component } from 'react';

class Cellar extends Component {
  render() {
    return (

      <div className="cellar"> 

        <p> Logged in! </p>

      </div>
      
    );
  }
}

export default Cellar;
